import React, { useState } from "react";
import FeedBackForm from "./Component/FeedBackForm/FeedBackForm";
import ThankYouCard from "./Component/ThankYouCard/ThankYouCard";

function App() {
  const [show,setShow]=useState(false)

  const Data = {
    title: "How did we do?",
    paragraph:
      "Please let us know how we did with your support request. All feedback is appreciated to help us improve our offering!",
    rating: [1, 2, 3, 4, 5],
  };

  return (
    <React.Fragment>
      <div class="card mx-auto mt-3" style={{ width: "20rem" }}>

         <FeedBackForm Data={Data} shouldIShow={show}/>
        <ThankYouCard shouldIShow={!show}/>


      </div>
    </React.Fragment>
  );
}

export default App;
